import "./CheckOut.css";

const CheckOut = () => {
  return (
    <section className="checkout_page">
      <h1 className="checout">Checkout</h1>
      <div class="cart_container">
        <div className="left_page"></div>
        <div className="right_page"></div>
      </div>
    </section>
  );
};

export default CheckOut;
